import React from "react";
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Slider from '@mui/material/Slider';
import Box from '@mui/material/Box';
import './Services.css';
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormLabel from '@mui/material/FormLabel';
import IconButton from '@mui/material/IconButton';
import Input from '@mui/material/Input';
import FilledInput from '@mui/material/FilledInput';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';

const marks = [
    {
      value: 0,
      label: 'Male',
    },
    {
      value: 1,
      label: 'Female',
    },
  ];
  const chest_pain =[
   {
    value:0,
    label: "&nbsp  Asymptomatic",
   },
   {
    value:1,
    label: 'Typical Angina',
   },
   {
    value:2,
    label: 'Atypical Angina',
   },
   {
    value:3,
    label: 'Non-Anginal Pain',
   },
  ];
const Services = () => {
    return (

      <div>
        <h1 className="serv">Services</h1>
        <form>
            <Grid container spacing={6}>
                <Grid item xs={6}  >

                <label>Age</label> <br></br>
                <TextField
                className="grid1"
                variant='outlined'
                label='Age'
                type='number'
                />

                <Box className="grid1 gr">
                 <label >Chest Pain(0 = Asymptomatic, 1 = Typical Angina, 2 = Atypical Angina, 3 = Non-Anginal Pain)</label>   
                <Slider
                label="Chest Pain"
                defaultValue={1}
                step={null}
                marks={chest_pain}
                min={0}
                max={3}
                valueLabelDisplay="auto"

                />
                </Box>

                <label>Blood Pressure</label><br></br>
                <TextField 
                className="grid1" 
                variant='outlined'
                label='Blood Pressure'
                type='number'
                />

                </Grid >
                <Grid item xs={6} >
                <Box className="grid2">
                <label>Gender</label>   
                <Slider 
                label="Gender"
                defaultValue={0}
                step={1}
                marks={marks}
                min={0}
                max={1}
                valueLabelDisplay="off"           
                />
                </Box>

                <label class="grid2" >Cholesterol(mg/dl)</label><br></br>
                <TextField
                class="text3" 
                variant='outlined'
                label=''
                type='number'

                />
                <br></br>
                <FormControl class="grid2">
                <FormLabel id="demo-radio-buttons-group-label">Fasting Blood Sugar (mg/dl)</FormLabel>
                <RadioGroup
                    aria-labelledby="demo-radio-buttons-group-label"
                    defaultValue="less"
                    name="radio-buttons-group"
                >
                    <FormControlLabel value="less" control={<Radio />} label="Less than or equal to 120" />
                    <FormControlLabel value="more" control={<Radio />} label="More than 120" />

                </RadioGroup>
                </FormControl>
                </Grid>

            </Grid>




        </form>
      </div>

    )
  }

  export default Services;
